    protected override async Task OnInitializedAsync()
    {
        stocks = await StockService.GetStocksAsync();
    }
    void OnEdit(Stock stock)
    {
        edition = true;
        sto = stock;
    }
    void OnCancel()
    {
        edition = false;
        sto = new Stock();
    }
